import * as React from "react";

export interface IMuscleDetail{
    tag:string;
    name?:string;
    path?:string;
}

interface IMuscle {
    isSelected: boolean;
    onClick:(tag:string)=>void,
    path:string,
    tag:string
}

class Muscle extends React.Component<IMuscle>{
    getClassName(isSelected:boolean):string{
        return "muscle waves-effect waves-circle waves-orange"  + (this.props.isSelected?" active":"");
    }
    render(){
        return <path onClick={()=>this.props.onClick(this.props.tag)} id={this.props.tag} d={this.props.path} className={this.getClassName(this.props.isSelected)}/>
    }
}

interface IMuscleSelector {
    onChange?: (tags:string[])=>void,
    selectedTags?: string[]
}
interface IMuscleSelected{
     [index: string]: boolean;
}
interface IMuscleSelectorState{
    selections:IMuscleSelected[]
}

export class MuscleSelector extends React.Component<IMuscleSelector,IMuscleSelectorState>{
    state:IMuscleSelectorState={selections:{} as IMuscleSelected[]}
    selectedItems:IMuscleSelected[] = {} as IMuscleSelected[];

    constructor(props){
        super(props);
        this.handleClick = this.handleClick.bind(this);
        this.handleRemove = this.handleRemove.bind(this);
    }

    handleClick = function(tag:string):void{
        var newArray:string[];
        if (this.props.selectedTags){
            newArray = this.props.selectedTags as string[];
        }else{
            newArray = new Array();
        }
        var index =this.props.selectedTags ?newArray.indexOf(tag):-1;
        if (index>-1){
            newArray.splice(index,1);
        }else{
            newArray.push(tag);
        }
       
        this.props.onChange(newArray);
    }

    handleRemove = function(tag:string):void{
        
        var newArray = this.props.selectedTags as string[];
        var index =newArray.indexOf(tag);
        newArray.splice(index,1);
        this.props.onChange(newArray);
    }

    getSelected = function():IMuscleDetail[]{
        return this.props.selectedTags.map(e=>muscleDetails.find(d=>d.tag ==e));
    }

    render(){
          return <div>
          
           <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 835.52002 813.12">
            <g>
                {muscleDetails.map(muscle=><Muscle path={muscle.path} tag={muscle.tag} key={muscle.tag} onClick={this.handleClick} 
                    isSelected={this.props.selectedTags.indexOf(muscle.tag) > -1}  /> )}
            </g>
            </svg>
            <div className="row">
                {this.getSelected().map(s=><div key={s.tag} className="chip">{s.name} <i onClick={()=>this.handleRemove(s.tag)} className="close material-icons">close</i> </div>)}
                </div>
            </div>
    }
}

